import React, { Component } from 'react'

export default class myproduct extends Component {


    constructor(props) {
        super(props);

        this.state = {
            product: "",
        }
    }
    componentDidMount() {
        this.getOne()
    }

    getOne(){
        axios.get("http://localhost:8080/backMyprod/"+localStorage.getItem("id"))
        .then(res => {
            this.setState({
                product: res.data

            })
            console.log(res.data);

        }).catch(err => {
            console.log(err);

        })
    }



    render() {
        return (
            <div>
                <h2>Tous mes produit</h2>

            </div>
        )
    }
}
